class Config{

    // SITE INFO
    static logoSm = "https://via.placeholder.com/80x"

    // PAGES URL
    static homePageUrl = "/";
    static loginPageUrl = "/login";
    static registerPageUrl = "/register";
    static profilePageUrl = "/profile";
    static logoutPageUrl = "/logout";
}
export default Config;
